import React from "react";
import Card from "antd/es/card/Card";

// const { Meta } = Card;

const ProductCard = () => {
   return (
      <Card
      hoverable
      style={{ width: 240 }}
      cover={
         <img
            alt="example"
            src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png"
         />
      }
      >
      <p>Green Apple</p>
      <p></p>
      </Card>
   );
};

export default ProductCard;
